function addSearchKey(caseItem, searchKey) {
    var searchKeyLabel = searchKey + "Label";
    var searchKeyValue = searchKey + "Value";
    if (caseItem[searchKeyLabel]) {
        return  '<div>' +
                '    <div class="case-property-label">' + uiTranslate(caseItem[searchKeyLabel]) + '</div>' +
                '    <div class="case-property-value">' + caseItem[searchKeyValue] + '</div>' +
                '</div>';
    }
    return "";
}

return function(caseItem) {
    var searchKeysString = "";
    return '<div class="search-keys-container">' +
        addSearchKey(caseItem, "searchIndex1") +
        addSearchKey(caseItem, "searchIndex2") +
        addSearchKey(caseItem, "searchIndex3") +
        addSearchKey(caseItem, "searchIndex4") +
        addSearchKey(caseItem, "searchIndex5") +
    '</div>'; 
}

eventHandler.value:
// diplay the first page of open cases on page load or when the filter change
if($data.openCases){
    $data.displayedOpenCases = $data.openCases;
    $data.caseListConfiguration.pageId = 1;
    // set open cases to undefined as the script is triggered when click on load more cases button
    // and to prevent this block of code from being executed (prevent resetting the displayedOpenCases).
    $data.openCases = undefined; 
}

// add next page of open cases to the current list when user clicks on load more
if($data.openCasesNextResults && $data.openCasesNextResults.length){
    $data.displayedOpenCases = $data.displayedOpenCases.concat($data.openCasesNextResults);
    $data.caseListConfiguration.pageId++;
    $data.openCasesNextResults = [];
}

openCasesQueryParameters.value:
return function(pageId){
    var queryParameters = "?c=" + $data.caseListConfiguration.numberOfCasesPerPage + "&p=" + pageId + "&d=processDefinitionId&d=started_by&n=activeFlowNodes&n=failedFlowNodes";

    if($data.openCasesFilters.processDefinitionId){
        queryParameters += "&f=processDefinitionId=" +  $data.openCasesFilters.processDefinitionId;
    }

    if($data.openCasesFilters.startedByMe){
        queryParameters += "&f=started_by=" +  $data.session.user_id;
    }

    if($data.openCasesFilters.sortOrder){
        queryParameters += "&o=" +  $data.openCasesFilters.sortOrder;
    }

    if($data.openCasesFilters.searchValue){
        queryParameters += "&s=" +  $data.openCasesFilters.searchValue;
    }

    return queryParameters;
}

